class BookedVer extends React.Component {
    constructor(props) {
        super(props);
        this.state={
            resID: new URLSearchParams(window.location.search).get('resID'),

        }
    }

    render() { 
        return ( 
            <div>

                <input value={this.state.resID} type="text" />
                <button onClick={() => {navigator.clipboard.writeText(this.state.textToCopy)}}  className="px-5 py-3 bg-cyan-700 text-2xl font-semibold text-white"> Copy </button>

            </div>



         )
    }
}
 
export default BookedVer;
